import React from "react";

export default function Registerpage() {
  return (
    <div>
      <div className="row justify-content-center">
        <div className="col-md-4">
          <div>
            <input
              type="text"
              placeholder="Name"
              className="form-control"
              required
            />
          </div>
        </div>
      </div>
    </div>
  );
}
